@SaschaGlaeser @defpriorities I am no expert, much less on China. Anyway it seems to me Chinese leadership prioritizes internal stability, and sanctions would be a huge blow to China.
And would put at risk such stability.
In fact China has not helped Russia for fear of Sanctions.

@fixednonumbers @primkup1 @Jasperinboston @XSovietNews @mtracey And, my final thought:
If China offered Taiwan to relinquish  all claims on the nation in exchange for Taiwan promising to never join or aid in any attacks on China, Taiwan would do it in a minute.

The only country seeking war is China. The US is stopping a totalitarian regime.
